import React from 'react';

class Home extends React.Component{
    render() {
        return (
            <div>
                <div className="d-inline-block border p-3" style={{ maxWidth: '10%', margin: '5mm auto' }}>
                    Tekst w obramowaniu z ograniczoną długością
                </div>
            </div>
        );
    }
}

export default Home;
